import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import {AccountBookOutlined} from '@ant-design/icons';

import Homepage from "./Component/Homepage";
import AddBook from './Component/AddBook';
export const routes = [
  {
    path: "/",
    exact: true,
    component: Homepage
  },
  {
    path: "/Home",
    name: "Home",
    component: Homepage,
    nav: true
  },
  {
    path: "/AddBook",
    name: "Add Book",
    component: History,
    nav: true
  },
  {
    path: "/Bookmark",
    name: "Book mark",
    component: History,
    nav: true
  },
];

export const AppRouter = (props) => {
  return (
    <Router>
      <Switch>
        {routes.map((route, i) =>
          route.subPage ? (
            route.subPage.map((sub, j) => (
              <Route
                key={`${i}_${j}`}
                {...sub}
                path={`${route.path}${sub.path}`}
              />
            ))
          ) : (
            <Route key={i} {...route} />
          )
        )}
      </Switch>
    </Router>
  );
};
